B.Dn=new A.bk(" \u2013 bei der kleine Labels zu verschiedenen Themen ihr Unternehmen vorstellen konnten. Die Idee fand ich super und weil ich selbst sehr neugierig bin und gerne bei anderen durchs Fenster gucke und schaue wie sie wohnen \u2013 wollte ich das Konzept mit den Tages-Aufgaben f\xfcr die Interiorszene adaptieren. Es haben direkt beim ersten Mal viele gro\xdfe Accounts mitgemacht und mittlerweile gab es schon 13 Ausgaben (immer im Fr\xfchjahr und im Herbst). Wenn ich das so sage, bin ich immer wieder erstaunt. Unglaublich, was daraus geworden ist. Seit einem Jahr gibt es auch einen eigenen Account f\xfcr die Challenge - ",null)
